import React from 'react';
import { Input } from '@rocketseat/unform';

import { Container } from './styles';

export default function Encomendas() {
  return (
    <Container>
      <h2>Gerenciando Encomendas</h2>
      <Input
        name="filter"
        type="text"
        placeholder="Buscar por encomendas"
      ></Input>
    </Container>
  );
}
